  `max_money` double(15, 2) UNSIGNED NOT NULL DEFAULT 0.00 COMMENT '单笔最大金额',
  `settle_cbfeilv` decimal(5, 4) UNSIGNED NOT NULL DEFAULT 0.0000 COMMENT '结算成本费率',
  `del` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '删除状态：0=正常；1=已删除',
  `commission_rate` decimal(15, 4) UNSIGNED NULL DEFAULT 0.0000 COMMENT '账号所属用户的分润比例',
  `owner_id` int(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '账号所属者 0:系统 其他:用户id',
  `type` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '账号类型 0:普通 1:测试',
  `oddment` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '充值时是否给账号加零头 0:关闭 1:开启',
  `settle_min_cbfeilv` decimal(15, 4) UNSIGNED NOT NULL DEFAULT 0.0000 COMMENT '单笔结算最低成本,单位:元',
  `min_oddment` decimal(2, 0) NULL DEFAULT 1 COMMENT '充值零头下限',
  `max_oddment` decimal(2, 0) NULL DEFAULT 99 COMMENT '充值零头下限',
  `submiturl` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '提交地址',
  `notifyurl` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '异步回调地址',
  `callbackurl` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '同步回调地址',
  `user_payapiid` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '通道id：0=系统；其它的则为用户自指定的通道',
  `user_id` int(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '用户id,与通道账号类型匹配：0=系统；其它的为用户id',
  `default_status` tinyint(0) UNSIGNED NULL DEFAULT 0 COMMENT '自助账号的默认状态:0=普通；1=默认',
  `extra1` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '额外字段1',
  `extra2` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '额外字段2',
  `extra3` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '额外字段3',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 53 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '通道账号表' ROW_FORMAT = Compact;

