  `memberid` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '商户号',
  `bankname` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '银行名称',
  `bankzhiname` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '银行支行',
  `banknumber` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '银行联行号',
  `bankcode` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '银行编码',
  `bankcardnumber` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '银行卡号',
  `bankusername` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '银行卡户名',
  `identitynumber` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '身份证号',
  `phonenumber` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '手机号',
  `province` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '省',
  `city` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '市',
  `applytime` datetime(0) NULL DEFAULT NULL COMMENT '申请时间',
  `dealtime` datetime(0) NULL DEFAULT NULL COMMENT '处理时间',
  `type` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '类型  0：T + 0   1：T + 1',
  `status` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '状态 0：未处理 1：处理中  2：已打款  3:已退款',
  `ordermoney` decimal(15, 4) UNSIGNED NOT NULL DEFAULT 0.0000 COMMENT '提款金额',
  `refundmoney` decimal(15, 4) UNSIGNED NOT NULL DEFAULT 0.0000 COMMENT '退款金额',
  `remarks` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '备注',
  `refundstatus` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '退款状态 0:正常 1:退款中 2:已退款 3:拒绝退款',
  `refundremarks` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '退款备注',
  `notifyurl` varchar(5000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '异步回调地址',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 77 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '结算记录表' ROW_FORMAT = Dynamic;

