DROP TABLE IF EXISTS `pay_user`;
CREATE TABLE `pay_user`  (
  `id` int(0) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '主键',
  `username` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '用户名',
  `bieming` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '用户别名',
  `usertype` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '用户类型',
  `status` tinyint(0) UNSIGNED NOT NULL DEFAULT 2 COMMENT '状态，未激活，正常，禁用',
  `authentication` tinyint(0) NOT NULL DEFAULT 1 COMMENT '是否已认证：1=未认证；2=审核中；3=已认证',
  `superiorid` int(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '上级ID',
  `regdatetime` datetime(0) NOT NULL COMMENT '注册时间',
  `del` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '0 正常 , 1删除',
  `usercode` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户标识（充值时识别用户）',
  `order` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '交易开关 0:开启 1:关闭',
  `version_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '交易接口版本号id组',
  `settle_version` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '结算接口版本id组',
  `test_status` tinyint(0) UNSIGNED NOT NULL DEFAULT 1 COMMENT '1 正常状态   0 测试状态',
  `self_payapi` tinyint(0) UNSIGNED NOT NULL DEFAULT 2 COMMENT '自助通道状态:1=开通；2=未开通',
  `selfcash_status` tinyint(0) UNSIGNED NOT NULL DEFAULT 1 COMMENT '自助收银状态 1:开启 0:关闭',
  `selfcash_back` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '自助收银的背景图片路径',
  `selfcash_qrcode` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '自助收银二维码图片路径',
  `payapi_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '为用户指定的通道列表',
  `same_user` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否允许同一账号登录：0=开启；1=关闭',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `username`(`username`) USING BTREE,
  INDEX `id`(`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户表' ROW_FORMAT = Compact;

