  `address` varchar(300) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '公司地址',
  `register_time` datetime(0) NOT NULL COMMENT '成立时间',
  `legal_person` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '法人代表',
  `contacts` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '联系人姓名',
  `document_type` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '证件类型    0 身份证, 1居住证 ,2签证,3 护照,4 户口本,5 军人证,6 团员证 ,7党员证,8 港澳通行证',
  `document_number` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '证件号码',
  `sex` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '0 男   1 女',
  `birthday` datetime(0) NOT NULL COMMENT '生日',
  `phone_number` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '手机号',
  `email` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '电子邮箱',
  `qq_number` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT 'QQ号',
  `admin_password` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '管理密码',
  `email_time` datetime(0) NOT NULL COMMENT '忘记密码时：记录发送邮件的时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 4 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户信息表' ROW_FORMAT = Dynamic;

