  `del` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否删除 0=正常；1=已删除',
  `superior_id` int(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '敏感信息的上级信息id',
  PRIMARY KEY (`id`) USING BTREE
