  `title` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '标题,类似关键字',
  `content` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '问题内容',
  `help_content` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '手动添加的帮助文档的内容',
  `type` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '类型 0:手动添加 1:工单转帮助文档',
  `date_time` datetime(0) NULL DEFAULT NULL COMMENT '添加时间',
  `del` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '是否删除 0:正常 1:删除',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户工单帮助文档表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for pay_version
-- ----------------------------
DROP TABLE IF EXISTS `pay_version`;
CREATE TABLE `pay_version`  (
  `id` int(0) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '主键',
  `numberstr` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '版本号',
  `actionname` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '控制器名称',
  `bieming` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '接口版本别名',
  `status` tinyint(0) UNSIGNED NOT NULL DEFAULT 1 COMMENT '使用状态：1=正常；2=禁用',
  `del` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '删除状态：0=正常；1=已删除',
  `all_use` tinyint(0) UNSIGNED NOT NULL DEFAULT 2 COMMENT '通用开关：1=开启；2=关闭',
  `date_time` datetime(0) NOT NULL COMMENT '添加时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = MyISAM AUTO_INCREMENT = 3 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '版本信息表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of pay_version
-- ----------------------------

-- ----------------------------
-- Table structure for pay_website
-- ----------------------------
DROP TABLE IF EXISTS `pay_website`;
CREATE TABLE `pay_website`  (
  `id` int(0) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `websitename` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '网站名称',
  `tel` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '客服电话',
  `qq` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '客服qq',
  `register_number` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '网站备案号',
  `statistic_code` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '统计代码',
  `all_valve` tinyint(0) NOT NULL DEFAULT 0 COMMENT '全部开关 0  开启  ，  1关闭',
  `view_valve` tinyint(0) NOT NULL DEFAULT 0 COMMENT '前台开关   0  开启  ，  1关闭',
  `api_valve` tinyint(0) NOT NULL DEFAULT 0 COMMENT '接口开关   0  开启  ，  1关闭',
  `reg_valve` tinyint(0) NOT NULL DEFAULT 0 COMMENT '注册开关   0  开启  ，  1关闭',
  `home_domain` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '前台域名',
  `admin_domain` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '后台域名',
  `pay_domain` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '支付域名',
  `back_domain` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '回调域名',
  `admin_password` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '密码',
  `home_http` tinyint(0) UNSIGNED NOT NULL DEFAULT 1 COMMENT '前台域名的传输协议：1=http://;2=https://',
  `admin_http` tinyint(0) UNSIGNED NOT NULL DEFAULT 1 COMMENT '后台域名的传输协议：1=http://;2=https://',
  `pay_http` tinyint(0) UNSIGNED NOT NULL DEFAULT 1 COMMENT '支付域名的传输协议：1=http://;2=https://',
  `back_http` tinyint(0) UNSIGNED NOT NULL DEFAULT 1 COMMENT '回调域名的传输协议：1=http://;2=https://',
  `commission_level` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '提成等级：必须大于0',
  `settle_valve` tinyint(0) NOT NULL DEFAULT 1 COMMENT '结算开关 1:开启 0:关闭 与settleconfig表的status功能相同',
  `refund_valve` tinyint(0) NOT NULL DEFAULT 0 COMMENT '结算退款按钮 0:开启 1:关闭',
  `reg_status` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '默认注册状态：0=不设置；1=未激活；2=正常；3=禁用',
  `login_count` tinyint(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '登录限制次数',
  `set_time` int(0) UNSIGNED NOT NULL DEFAULT 0 COMMENT '登录限制时长：单位分钟',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '网站信息表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Records of pay_website
