-- ----------------------------
-- View structure for pay_jsbank
-- ----------------------------
DROP VIEW IF EXISTS `pay_jsbank`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `pay_jsbank` AS select `pay_systembank`.`id` AS `id`,`pay_systembank`.`bankname` AS `bankname`,`pay_systembank`.`bankcode` AS `bankcode`,`pay_systembank`.`del` AS `del` from `pay_systembank` where (`pay_systembank`.`jiesuan` = 1);

-- ----------------------------
-- View structure for pay_jybank
-- ----------------------------
DROP VIEW IF EXISTS `pay_jybank`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `pay_jybank` AS select `pay_systembank`.`id` AS `id`,`pay_systembank`.`bankname` AS `bankname`,`pay_systembank`.`bankcode` AS `bankcode`,`pay_systembank`.`del` AS `del` from `pay_systembank` where (`pay_systembank`.`jiaoyi` = 1);

-- ----------------------------
-- View structure for pay_orderinfo
-- ----------------------------
DROP VIEW IF EXISTS `pay_orderinfo`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `pay_orderinfo` AS select `pay_order`.`id` AS `orderid`,`pay_order`.`userordernumber` AS `userordernumber`,`pay_order`.`sysordernumber` AS `sysordernumber`,`pay_order`.`shangjiaid` AS `shangjiaid`,`pay_order`.`payapiid` AS `payapiid`,`pay_order`.`payapiaccountid` AS `payapiaccountid`,`pay_order`.`memberid` AS `memberid`,`pay_order`.`userid` AS `userid`,`pay_order`.`datetime` AS `datetime`,`pay_ordermoney`.`ordermoney` AS `ordermoney`,`pay_ordermoney`.`traderate` AS `traderate`,`pay_ordermoney`.`moneytrade` AS `moneytrade`,`pay_ordermoney`.`costrate` AS `costrate`,`pay_ordermoney`.`moneycost` AS `moneycost`,`pay_ordermoney`.`money` AS `money`,`pay_ordermoney`.`freezemoney` AS `freezemoney`,`pay_order`.`status` AS `status`,`pay_order`.`successtime` AS `successtime`,`pay_order`.`type` AS `type`,`pay_order`.`userip` AS `userip`,`pay_order`.`complaint` AS `complaint`,`pay_ordermoney`.`true_ordermoney` AS `true_ordermoney`,`pay_payapiaccount`.`bieming` AS `bieming`,`pay_payapiaccount`.`user_id` AS `users_id`,`pay_payapiaccount`.`moneytypeclassid` AS `moneytypeclassid`,(select `pay_payapi`.`zh_payname` from `pay_payapi` where (`pay_payapi`.`id` = `pay_order`.`payapiid`)) AS `payapiname`,(select `pay_payapiclass`.`classname` from `pay_payapiclass` where (`pay_payapiclass`.`id` = `pay_order`.`payapiclassid`)) AS `payapiclassname`,`pay_order`.`payapiclassid` AS `payapiclassid` from ((`pay_order` join `pay_ordermoney`) join `pay_payapiaccount`) where ((`pay_order`.`sysordernumber` = `pay_ordermoney`.`sysordernumber`) and (`pay_payapiaccount`.`id` = `pay_order`.`payapiaccountid`));

-- ----------------------------
-- View structure for pay_settleinfo
-- ----------------------------
DROP VIEW IF EXISTS `pay_settleinfo`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `pay_settleinfo` AS select `pay_settle`.`id` AS `settleid`,`pay_settle`.`ordernumber` AS `ordernumber`,`pay_settle`.`userid` AS `userid`,`pay_settle`.`memberid` AS `memberid`,`pay_settle`.`bankname` AS `bankname`,`pay_settle`.`bankzhiname` AS `bankzhiname`,`pay_settle`.`banknumber` AS `banknumber`,`pay_settle`.`bankcode` AS `bankcode`,`pay_settle`.`bankcardnumber` AS `bankcardnumber`,`pay_settle`.`bankusername` AS `bankusername`,`pay_settle`.`identitynumber` AS `identitynumber`,`pay_settle`.`phonenumber` AS `phonenumber`,`pay_settle`.`province` AS `province`,`pay_settle`.`city` AS `city`,`pay_settle`.`applytime` AS `applytime`,`pay_settle`.`dealtime` AS `dealtime`,`pay_settle`.`type` AS `type`,`pay_settle`.`status` AS `status`,`pay_settlemoney`.`ordermoney` AS `ordermoney`,`pay_settlemoney`.`traderate` AS `traderate`,`pay_settlemoney`.`moneytrade` AS `moneytrade`,`pay_settlemoney`.`costrate` AS `costrate`,`pay_settlemoney`.`moneycost` AS `moneycost`,`pay_settlemoney`.`profit` AS `profit`,`pay_settlemoney`.`money` AS `money`,`pay_settlemoney`.`shangjiaid` AS `shangjiaid`,`pay_settlemoney`.`accountid` AS `accountid`,`pay_settlemoney`.`daifuid` AS `daifuid`,`pay_settle`.`remarks` AS `remarks`,`pay_settlemoney`.`deduction_type` AS `deduction_type` from (`pay_settle` join `pay_settlemoney`) where (`pay_settle`.`ordernumber` = `pay_settlemoney`.`ordernumber`);

-- ----------------------------
-- View structure for pay_todaypayapiaccountmoney
-- ----------------------------
DROP VIEW IF EXISTS `pay_todaypayapiaccountmoney`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `pay_todaypayapiaccountmoney` AS select `pay_order`.`shangjiaid` AS `shangjia`,`pay_order`.`payapiid` AS `payapiid`,`pay_order`.`payapiaccountid` AS `payapiaccountid`,`pay_order`.`userid` AS `userid`,sum(`pay_ordermoney`.`ordermoney`) AS `money` from (`pay_order` join `pay_ordermoney`) where ((`pay_order`.`sysordernumber` = `pay_ordermoney`.`sysordernumber`) and ((to_days(now()) - to_days(`pay_order`.`datetime`)) = 0) and (`pay_order`.`status` > 0)) group by `pay_order`.`shangjiaid`,`pay_order`.`payapiid`,`pay_order`.`payapiaccountid`,`pay_order`.`datetime`;

-- ----------------------------
-- View structure for pay_userlogin
-- ----------------------------
DROP VIEW IF EXISTS `pay_userlogin`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `pay_userlogin` AS select `pay_user`.`id` AS `id`,`pay_user`.`username` AS `username`,`pay_userloginname`.`logintel` AS `logintel`,`pay_userloginname`.`loginemail` AS `loginemail`,`pay_userpassword`.`loginpassword` AS `loginpassword`,`pay_user`.`status` AS `status` from ((`pay_user` join `pay_userloginname`) join `pay_userpassword`) where ((`pay_user`.`id` = `pay_userloginname`.`userid`) and (`pay_user`.`id` = `pay_userpassword`.`userid`));

-- ----------------------------
-- View structure for pay_userpayapiaccountlist
-- ----------------------------
DROP VIEW IF EXISTS `pay_userpayapiaccountlist`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `pay_userpayapiaccountlist` AS select `pay_userpayapiaccountview`.`id` AS `id`,`pay_userpayapiaccountview`.`userid` AS `userid`,`pay_userpayapiaccountview`.`payapiid` AS `payapiid`,`pay_userpayapiaccountview`.`payapiaccountid` AS `payapiaccountid`,`pay_tongdaozhanghao`.`money` AS `money` from (`pay_userpayapiaccountview` join `pay_tongdaozhanghao`) where ((`pay_userpayapiaccountview`.`userid` = `pay_tongdaozhanghao`.`userid`) and (`pay_userpayapiaccountview`.`payapiid` = `pay_tongdaozhanghao`.`payapiid`) and (`pay_userpayapiaccountview`.`payapiaccountid` = `pay_tongdaozhanghao`.`payapiaccountid`));

-- ----------------------------
-- View structure for pay_userpayapiaccountview
-- ----------------------------
DROP VIEW IF EXISTS `pay_userpayapiaccountview`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `pay_userpayapiaccountview` AS select `pay_userpayapiaccount`.`id` AS `id`,`pay_userpayapiclass`.`userid` AS `userid`,`pay_userpayapiclass`.`payapiid` AS `payapiid`,`pay_userpayapiaccount`.`accountid` AS `payapiaccountid` from (`pay_userpayapiaccount` join `pay_userpayapiclass`) where (`pay_userpayapiaccount`.`userpayapiclassid` = `pay_userpayapiclass`.`id`);

-- ----------------------------
