DROP FUNCTION IF EXISTS `getaccountname`;
delimiter ;;
CREATE FUNCTION `getaccountname`(`idid` int)
 RETURNS varchar(255) CHARSET utf8
  NO SQL 
BEGIN
	#Routine body goes here...

	RETURN IFNULL((SELECT IFNULL(bieming,'无') FROM pay_payapiaccount where id = idid),'无');
END
;;
delimiter ;

